ve DOES NOT  DELIGHT IN EVIL  BUT REJOICES WITH THE TRUTH. 7 It always protects, always trusts, always hopes, always perseveres.\n8 Love never fails. But where there are prophecies, they will cease; where there are tongues, they will be stilled; where there is knowledge, it will pass away.\n\nplease seek, love, listen and obey God...only then will you walk in the fullness of all He has promised. Surrender all your burdens and worries to the one who loves enough to die for your sins. You have everything to gain with Jesus Christ. PLEASE GIVE HIM A CHANCE AND SEE YOUR LIFE CHANGE FOR THE BETTER.\n\nThis is all out of love guys, i want us all to go to heaven. Be blessed Shalom",
