              "textDisplay": "Most atheists I know don't even call themselves atheists. But among those who do recognize themselves as atheists, most define themselves as agnostic atheists.\n\nThe term agnostic deals with a certain concept and the term atheist deals with another. The two concepts are not mutually exclusive. Although in academia the definition of atheist (mostly set by theists) is different from the use given to it by most atheists.\n\nBTW, I do not believe in the existence of gods and other invisible beings with magical powers.",
              "textOriginal": "Most atheists I know don't even call themselves atheists. But among those who do recognize themselves as atheists, most define themselves as agnostic atheists.\n\nThe term agnostic deals with a certain concept and the term atheist deals with another. The two concepts are not mutually exclusive. Although in academia the definition of atheist (mostly set by theists) is different from the use given to it by most atheists.\n\nBTW, I do not believe in the existence of gods and other invisible beings with magical powers.",
