              "channelId": "UCMtFAi84ehTSYSE9XoHefig",
              "videoId": "P5ZOwNK6n9U",
              "textDisplay": "@Ansfrida Eyowulfsdottir \nI find that claiming God doesn't exist is a position I simply cannot defend. If I can't prove a universal negative then I surely can't prove a transcendental negative.\nI don't know and I don't claim to know whether any deities exist. Other people say these entities do existbut when asked to prove their claims, they fail.\nTheir arguments are unreasonable, so I am unable to reasonably accept them.\nIf you were to ask me \"Do you believe any deities exist?\" I would reply that I do not believe. As you said, knowledge and belief are two different things.\nI both [do not know] and [do not believe].\nIt seems to me that the definition of atheist \"One who affirms the belief that no deities exist\" is simply too stringent and exclusive. If I don't believe any deities exist, how am I _not_ an atheist?\nAll knowledge is beliefbut not all beliefs are knowledge. Knowledge is simply those beliefs that can be shown to be true.\nSo to me it makes more sense to divide _believing vs. not believing_ as separate categories, and then _claiming to know vs. not claiming to know_ as subdivisions within those respective categories.\nWords have different meanings and contexts. The self-labelled agnostic atheist is not saying \"I neither agree nor disagreebut I also know it's false,\" he is saying \"I don't know if it's true or falsebut I don't believe it's true.\"\nIt's not a meaningless term. You're simply shining the light of the wrong context upon it.",
              "textOriginal": "@Ansfrida Eyowulfsdottir \nI find that claiming God doesn't exist is a position I simply cannot defend. If I can't prove a universal negative then I surely can't prove a transcendental negative.\nI don't know and I don't claim to know whether any deities exist. Other people say these entities do existbut when asked to prove their claims, they fail.\nTheir arguments are unreasonable, so I am unable to reasonably accept them.\nIf you were to ask me \"Do you believe any deities exist?\" I would reply that I do not believe. As you said, knowledge and belief are two different things.\nI both [do not know] and [do not believe].\nIt seems to me that the definition of atheist \"One who affirms the belief that no deities exist\" is simply too stringent and exclusive. If I don't believe any deities exist, how am I _not_ an atheist?\nAll knowledge is beliefbut not all beliefs are knowledge. Knowledge is simply those beliefs that can be shown to be true.\nSo to me it makes more sense to divide _believing vs. not believing_ as separate categories, and then _claiming to know vs. not claiming to know_ as subdivisions within those respective categories.\nWords have different meanings and contexts. The self-labelled agnostic atheist is not saying \"I neither agree nor disagreebut I also know it's false,\" he is saying \"I don't know if it's true or falsebut I don't believe it's true.\"\nIt's not a meaningless term. You're simply shining the light of the wrong context upon it.",
