              "textDisplay": "\u200b@Adam Heywood \n*_\"I was under the impression that an Agnostic was one who positively asserted that it's impossible to know whether X was true or false\"_*\nThis is a common, grossly oversimplified misconception put about by American Atheists‚Ñ¢, ACA _et al._\n\nKnowledge has nothing to do with belief. It's two completely separate states. An Agnostic does not believe that either proposition is true and also does not believe that either proposition is false, even if this belief is based on another belief that it is impossible to know either way. An Agnostic suspends judgement on the truth value of both propositions, Theist and Atheist. An Igtheist also accepts neither proposition and rejects bothbut because they believe that any such conversation is utterly meaningless as the term \"god\" has no unambiguous definition. Theological noncognitivists are similar, in the sense that they hold that the language of any such discussion has no cognitive intelligibility within any philosophical theory of meaning.\n\nGnosticism was an early Christian sect from the first century AD that believed that the True God of the Pleroma was incomprehensible and unknowable and that YHWH was the Demiurge, or Yaldabaoth, the illegitimate, malformed, insane, psychotic child of Sophia, who gave birth without permission of the Monad. Sophia herself was a lower order emanation of the One True God, some say _Monad._ Yaldabaoth created the material plane and was deluded that it was the only Divine Being in existence. A Sumerian demon, if you will. The _\"Gnosis\"_ was secret, hidden, divinely revealed knowledge of the True God revealed through direct, personal enlightenment rather than religious scripture.\n\n\"Agnostic\" is a modern term coined by biologist Huxley in 1869 AD and is really one of the first examples of \"Scientism\". IE only empirical, scientific evidence can be valid:\n\n_\"Agnosticism is of the essence of science, whether ancient or modern. It simply means that a man shall not say he knows or believes that which he has no scientific grounds for professing to know or believe.\"_\n\nSo, even in this context, \"Agnostic Atheist\" is a nonsense because the Atheist has not received secret, hidden, divinely revealed knowledge that gods do not exist? And yet the Atheist believes that gods do not exist? He disagrees with both Theism and Atheism, agrees with neither and yet also believes that no gods exist?\n\n\"Gnostic Atheist\" is even worse, because they HAVE received this direct, divinely revealed, secret, esoteric knowledge that gods do not exist? From who?\n\nIn case you were wondering, I am an atheist. But I am a British Atheist who stopped following ACA and American Atheists‚Ñ¢ years ago because they talk such utter bilge and tripe. They invented _\"Lack-Theism\"_ as a re-definition of atheism because it was easier for people leaving their church in the Deep South to avoid arguments they cannot win with Snake Oil Salesmen:\n\n_\"I do not deny the existence of your god. I simply don't believe it.\"_\n\nThe tragedy is that 60 years later there are generations of people who cannot think clearly on these topics, and yet believe they are critical thinkers, just because they have rejected their parent's religion. All they have learned to do is stick their fingers in their ear, sing \"LA LA LA LA LAA!\" and shut down conversations like this one.\n\nI'm glad that you are not one of them!  ü§ó\n\n{:o:O:}",
